def calculate_distinct_sum(N, K, mod=1000000008):

    def p1(y, z, mod):
        ans = 1
        while z:
            if z % 2 == 1:
                ans = ans * y % mod
            y = y * y % mod
            z //= 2
        return ans

    def p2(x, y):
        if y >= 30:
            return p1(x, p1(2, y, mod - 1) + mod - 1, mod)
        return p1(x, 1 << y, mod)

    def calc(a, x, b):
        return (p1(p2(a, b), x, mod) - p1(a, x - 1, mod) + mod) % mod * a % mod * p1(a - 1, mod - 2, mod) % mod
    Sum = 1
    for j in range(2, N + 1):
        if j * j > N:
            break
        c = 0
        while N % j == 0:
            c += 1
            N //= j
        if c != 0:
            Sum = Sum * calc(j, c, K) % mod
    if N != 1:
        Sum = Sum * calc(N, 1, K) % mod
    return Sum

